import React from 'react';

export default class P1 extends React.Component {

    constructor(props) {
        super(props);
        console.log(props);
    }
    componentWillMount() {

    }

    render() {
        const fthis = this;
        return (
            <div style={{
                // overflow: "scroll"
                 backgroundColor: "black"
                , height: "1000px"
                , width: "300px"
            }}>
                <button onClick={() => {
                    fthis.props.myParent.setState({ focusOnPage: "p2" });
                }}
                    style={{ color: '#fff' }}>
                    <h1>p1-top</h1>
                    <h2>Go to P2</h2>
                </button>

                <button onClick={() => {
                    fthis.props.myParent.setState({ focusOnPage: "p3" });
                }}>
                    <h1 >p1-top</h1>
                    <h2>Back to P3</h2>
                </button>


                <button
                    style={{
                        color: '#fff', left: 0, top: 850, position: "absolute"
                    }}
                    onClick={() => {
                        fthis.props.myParent.setState({ focusOnPage: "p2" });
                    }}>
                    <h1>p1-bottom</h1>
                    <h2>Go to P2</h2>
                </button>
                <button
                    style={{
                        color: '#fff', left: "45%", top: 850, position: "absolute"
                    }}
                    onClick={() => {
                        fthis.props.myParent.setState({ focusOnPage: "p3" });
                    }}>
                    <h1>p1-bottom</h1>
                    <h2>Back to P3</h2>
                </button>


            </div>
        )
    }

}
